0;\u2014 \u0438\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%80%D0%BE%D0%BD%D1%88%D1%82%D0%B0%D0%B4%D1%82\" title=\"\u041a\u0440\u043e\u043d\u0448\u0442\u0430\u0434\u0442\">\u041a\u0440\u043e\u043d\u0448\u0442\u0430\u0434\u0442\u0430<\/a> \u0432 \u043a\u0440\u0443\u0433\u043e\u0441\u0432\u0435\u0442\u043d\u043e\u0435 \u043f\u043b\u0430\u0432\u0430\u043d\u0438\u0435 \u043e\u0442\u043f\u0440\u0430\u0432\u0438\u043b\u0438\u0441\u044c \u0448\u043b\u044e\u043f\u044b \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BE%D1%81%D1%82%D0%BE%D0%BA_(%D1%88%D0%BB%D1%8E%D0%BF)\" title=\"\u0412\u043e\u0441\u0442\u043e\u043a (\u0448\u043b\u044e\u043f)\">\u0412\u043e\u0441\u0442\u043e\u043a<\/a>\u00bb \u0438 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B8%D1%80%D0%BD%D1%8B%D0%B9_(%D1%88%D0%BB%D1%8E%D0%BF)\" title=\"\u041c\u0438\u0440\u043d\u044b\u0439 (\u0448\u043b\u044e\u043f)\">\u041c\u0438\u0440\u043d\u044b\u0439<\/a>\u00bb. \u0412\u043e \u0432\u0440\u0435\u043c\u044f \u044d\u0442\u043e\u0439 \u044d\u043a\u0441\u043f\u0435\u0434\u0438\u0446\u0438\u0438 \u0431\u044b\u043b \u043e\u0442\u043a\u0440\u044b\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D1%82%D0%B0%D1%80%D0%BA%D1%82%D0%B8%D0%B4%D0%B0\" title=\"\u0410\u043d\u0442\u0430\u0440\u043a\u0442\u0438\u0434\u0430\">\u00ab\u0448\u0435\u0441\u0442\u043e\u0439\u00bb \u043a\u043e\u043d\u0442\u0438\u043d\u0435\u043d\u0442<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1832_%D0%B3%D0%BE%D0%B4\" title=\"1832 \u0433\u043e\u0434\">1832<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BE%D1%81%D1%82%D0%BE%D0%BD\" title=\"\u0411\u043e\u0441\u0442\u043e\u043d\">\u0411\u043e\u0441\u0442\u043e\u043d\u0435<\/a> \u0434\u0435\u0442\u0441\u043a\u0438\u043c \u0445\u043e\u0440\u043e\u043c \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u0438\u0441\u043f\u043e\u043b\u043d\u0435\u043d \u043f\u0430\u0442\u0440\u0438\u043e\u0442\u0438\u0447\u0435\u0441\u043a\u0