%A3%D0%BE%D0%BB%D1%82\" title=\"\u0423\u0438\u0442\u043c\u0435\u043d, \u0423\u043e\u043b\u0442\">\u0423\u043e\u043b\u0442\u0430 \u0423\u0438\u0442\u043c\u0435\u043d\u0430<\/a> \u00ab\u041b\u0438\u0441\u0442\u044c\u044f \u0442\u0440\u0430\u0432\u044b\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1862_%D0%B3%D0%BE%D0%B4\" title=\"1862 \u0433\u043e\u0434\">1862<\/a>&#160;\u2014 \u0432\u043e \u0432\u0440\u0435\u043c\u044f \u043f\u0438\u043a\u043d\u0438\u043a\u0430 \u0427\u0430\u0440\u043b\u044c\u0437 \u0414\u043e\u0434\u0436\u0441\u043e\u043d \u043d\u0430\u0447\u0430\u043b \u0440\u0430\u0441\u0441\u043a\u0430\u0437\u044b\u0432\u0430\u0442\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B8%D0%B4%D0%B4%D0%B5%D0%BB%D0%BB,_%D0%90%D0%BB%D0%B8%D1%81%D0%B0_%D0%9F%D0%BB%D0%B5%D0%B7%D0%B5%D0%BD%D1%81\" class=\"mw-redirect\" title=\"\u041b\u0438\u0434\u0434\u0435\u043b\u043b, \u0410\u043b\u0438\u0441\u0430 \u041f\u043b\u0435\u0437\u0435\u043d\u0441\">\u0410\u043b\u0438\u0441\u0435 \u041b\u0438\u0434\u0434\u0435\u043b\u043b<\/a> \u0438\u0441\u0442\u043e\u0440\u0438\u044e \u043e \u0434\u0435\u0432\u043e\u0447\u043a\u0435, \u043f\u043e\u0431\u0435\u0436\u0430\u0432\u0448\u0435\u0439 \u0432\u0441\u043b\u0435\u0434 \u0437\u0430 \u043a\u0440\u043e\u043b\u0438\u043a\u043e\u043c \u0432 \u0421\u0442\u0440\u0430\u043d\u0443 \u0447\u0443\u0434\u0435\u0441. \u0414\u0435\u0441\u044f\u0442\u0438\u043b\u0435\u0442\u043d\u044f\u044f \u0434\u0435\u0432\u043e\u0447\u043a\u0430 \u0441\u0442\u0430\u043b\u0430 \u043d\u0430\u0441\u0442\u0430\u0438\u0432\u0430\u0442\u044c, \u0447\u0442\u043e\u0431\u044b \u043e\u043d \u0437\u0430\u043f\u0438\u0441\u0430\u043b \u0432\u0441\u044e \u0438\u0441\u0442\u043e\u0440\u0438\u044e. \u0414\u043e\u0434\u0436\u0441\u043e\u043d \u043f\u043e\u0441\u043b\u0435\u0434\u043e\u0432\u0430\u043b \u0441\u043e\u0432\u0435\u0442\u0443 \u0438 \u043f\u043e\u0434 \u0438\u043c\u0435\u043d\u0435\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D1%8C%D1%8E%D0%B8%D1%81_%D0%9A%D1%8D%D1%80%D1%80%D0%BE%D0%BB%D0%BB\" title=\"\u041b\u044c\u044e\u0438\u0441 \u041a\u044d\u0440\u0440\u043e\u043b\u043b\">\u041b\u044c\u044e\u0438\u0441\u0430 \u041a\u044d\u0440\u0440\u043e\u043b\u043b\u0430<\/a> \u043d\u0430\u043f\u0438\u0441\u0430\u043b \u043a\u043d\u0438\u0436\u043a\u0443 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BB%D0%B8%D1%81%D0%B0_%D0%B2_%D0%A1%D1%82%D1%80%D0%B0%D0%BD%D0%B5_%D1%87%D1%83%D0%B4%D0%B5%D1%81\" title=\"\u0410\u043b\u0438\u0441\u0430 \u0432 \u0421\u0442\u0440\u0430\u043d\u0435 \u0447\u0443\u0434\u0435\u0441\">\u0410\u043b\u0438\u0441\u0430 \u0432 \u0421\u0442\u0440\u0430\u043d\u0435 \u0447\u0443\u0434\u0435\u0441<\/a>\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1865_%D0%B3%D0%BE%D0%B4\" title=\"1865 \u0433\u043e\u0434\">1865<\/a>&#160;\u2014 \u0432 \u0438\u0437\u0434\u0430\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u0435 \u00abMacmillan and Co\u00bb \u0432\u044b\u0448\u043b\u043e \u043f\u0435\u0440\u0432\u043e\u0435 \u0438\u0437\u0434\u0430\u043d\u0438\u0435 \u043a\u043d\u0438\u0433\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D1%8C%D1%8E%D0%B8%D1%81_%D0%9A%D1%8D%D1%80%D1%80%D0%BE%D0%BB%D0%BB\" title=\"\u041b\u044c\u044e\u0438\u0441 \u041a\u044d\u0440\u0440\u043e\u043b\u043b\">\u041b\u044c\u044e\u0438\u0441\u0430 \u041a\u044d\u0440\u0440\u043e\u043b\u0430<\/a> \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BB%D0%B8%D1%81%D0%B0_%D0%B2_%D0%A1%D1%82%D1%80%D0%B0%D0%BD%D0%B5_%D1%87%D1%83%D0%B4%D0%B5%D1%81\" title=\"\u0410\u043b\u0438\u0441\u0430 \u0432 \u0421\u0442\u0440\u0430\u043d\u0435 \u0447\u0443\u0434\u0435\u0441\">\u0410\u043b\u0438\u0441\u0430 \u0432 \u0421\u0442\u0440\u0430\u043d\u0435 \u0447\u0443\u0434\u0435\u0441<\/a>\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1874_%D0%B3%D0%BE%D0%B4\" title=\"1874 \u0433\u043e\u0434\">1874<\/a>&#160;\u2014 \u043f\u043e\u0441\u0442\u0440\u043e\u0435\u043d \u043f\u0435\u0440\u0432\u044b\u0439 \u