u0421\u0442\u0430\u043d\u043e\u0432\u043e\u0439 \u043f\u0440\u0438\u0441\u0442\u0430\u0432\">\u0441\u0442\u0430\u043d\u043e\u0432\u044b\u0445 \u043f\u0440\u0438\u0441\u0442\u0430\u0432\u043e\u0432<\/a>).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1886_%D0%B3%D0%BE%D0%B4\" title=\"1886 \u0433\u043e\u0434\">1886<\/a><ul><li>\u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D1%8C%D1%8E-%D0%99%D0%BE%D1%80%D0%BA\" title=\"\u041d\u044c\u044e-\u0419\u043e\u0440\u043a\">\u041d\u044c\u044e-\u0419\u043e\u0440\u043a<\/a> \u043f\u0440\u0438\u0431\u044b\u043b\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%82%D0%B0%D1%82%D1%83%D1%8F_%D0%A1%D0%B2%D0%BE%D0%B1%D0%BE%D0%B4%D1%8B\" title=\"\u0421\u0442\u0430\u0442\u0443\u044f \u0421\u0432\u043e\u0431\u043e\u0434\u044b\">\u0441\u0442\u0430\u0442\u0443\u044f \u0421\u0432\u043e\u0431\u043e\u0434\u044b<\/a>, \u043a\u043e\u0442\u043e\u0440\u0430\u044f \u0442\u043e\u0440\u0436\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e \u043e\u0442\u043a\u0440\u043e\u0435\u0442\u0441\u044f 26 \u043e\u043a\u0442\u044f\u0431\u0440\u044f.<\/li><li>\u0412 \u0433\u043e\u0440\u043e\u0434\u043a\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D0%B5%D1%81%D0%BA%D0%BE%D1%82%D1%82_(%D0%90%D1%80%D0%B8%D0%B7%D0%BE%D0%BD%D0%B0)\" title=\"\u041f\u0440\u0435\u0441\u043a\u043e\u0442\u0442 (\u0410\u0440\u0438\u0437\u043e\u043d\u0430)\">\u041f\u0440\u0435\u0441\u043a\u043e\u0442\u0442<\/a> (\u0448\u0442\u0430\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%80%D0%B8%D0%B7%D0%BE%D0%BD%D0%B0\" title=\"\u0410\u0440\u0438\u0437\u043e\u043d\u0430\">\u0410\u0440\u0438\u0437\u043e\u043d\u0430<\/a>) \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0439 \u043a\u043e\u0432\u0431\u043e\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%83%D1%84%D1%84%D0%B0%D0%BB%D0%BE_%D0%91%D0%B8%D0%BB%D0%BB\" title=\"\u0411\u0443\u0444\u0444\u0430\u043b\u043e \u0411\u0438\u043b\u043b\">\u0411\u0443\u0444\u0444\u0430\u043b\u043e \u0411\u0438\u043b\u043b<\/a> \u043f\u0440\u043e\u0434\u0435\u043c\u043e\u043d\u0441\u0442\u0440\u0438\u0440\u043e\u0432\u0430\u043b \u043f\u0435\u0440\u0432\u043e\u0435 \u0441\u043e\u0440\u0435\u0432\u043d\u043e\u0432\u0430\u043d\u0438\u0435 \u043f\u043e \u0440\u043e\u0434\u0435\u043e.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1892_%D0%B3%D0%BE%D0%B4\" title=\"1892 \u0433\u043e\u0434\">1892<\/a>&#160;\u2014 \u0432 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BC%D0%BE%D0%B0\" title=\"\u0421\u0430\u043c\u043e\u0430\">\u0421\u0430\u043c\u043e\u0430<\/a> \u043f\u0440\u043e\u0438\u0437\u043e\u0448\u043b\u043e \u0434\u0432\u0430 4 \u0438\u044e\u043b\u044f \u043f\u043e\u0434\u0440\u044f\u0434, \u043f\u043e\u0441\u043a\u043e\u043b\u044c\u043a\u0443 \u043f\u043e \u0440\u0430\u0441\u043f\u043e\u0440\u044f\u0436\u0435\u043d\u0438\u044e \u043a\u043e\u0440\u043e\u043b\u044f \u0421\u0430\u043c\u043e\u0430 \u043f\u0435\u0440\u0435\u0448\u043b\u043e \u0432 \u0447\u0430\u0441\u043e\u0432\u043e\u0439 \u043f\u043e\u044f\u0441, \u043d\u0430\u0445\u043e\u0434\u044f\u0449\u0438\u0439\u0441\u044f \u043d\u0430 24 \u0447\u0430\u0441\u0430 \u043d\u0430\u0437\u0430\u0434&#160;\u2014 \u043a \u0432\u043e\u0441\u0442\u043e\u043a\u0443 \u043e\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B8%D0%BD%D0%B8%D1%8F_%D0%BF%D0%B5%D1%80%D0%B5%D0%BC%D0%B5%D0%BD%D1%8B_%D0%B4%D0%B0%D1%82%D1%8B\" title=\"\u041b\u0438\u043d\u0438\u044f \u043f\u0435\u0440\u0435\u043c\u0435\u043d\u044b \u0434\u0430\u0442\u044b\">\u043b\u0438\u043d\u0438\u0438 \u043f\u0435\u0440\u0435\u043c\u0435\u043d\u044b \u0434\u0430\u0442<\/a> , \u0447\u0442\u043e\u0431\u044b \u043e\u0431\u043b\u0435\u0433\u0447\u0438\u0442\u044c \u0442\u043e\u0440\u0433\u043e\u0432\u043b\u044e \u0441 \u0421\u0428\u0410.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1894_%D0%B3%D0%BE%D0%B4\" title=\"1894 \u0433\u043e\u0434\">1894<\/a>&#160;\u2014 \u0432\u043e\u043f\u0440\u0435\u043a\u0438 \u0441\u043e\u043f\u0440\u043e\u0442\u0438\u0432\u043b\u0435\u043d\u0438\u044e \u043c\u043e\u043d\u0430\u0440\u0445\u0438\u0441\u0442\u043e\u0432 \u043f\u0440\u043e\u0432\u043e\u0437\u0433\u043b\u0430\u0448\u0435\u043d\u0430 \u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430 \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B0%D0%B2%D0%B0%D0%B9%D1%81%D0%BA%D0%B8%D0%B5_%D0%BE%D1%81%D1%82%D1%80%D0%BE%D0%B2%D0%B0\" title=\"\u0413\u0430\u0432\u0430\u0439\u0441\u043a\u0438\u0435 \u043e\u0441\u0442\u0440\u043e\u0432\u0430\">\u0413\u0430\u0432\u0430\u0439\u0441\u043a\u0438\u0445 \u043e\u0441\u0442\u0440\u043e\u0432\u0430\u0445<\/a>.<\/li><\/ul><h3>XX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1903_%D0%B3%D0%BE%D0%B4\" title=\"1903 \u0433\u043e\u0434\">1903<\/a>&#160;\u2014 \u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D1%83%D0%B7%D0%B2%D0%B5%D0%BB%D1%8C%D1%82,_%D0%A2%D0%B5%D0%BE%D0%B4%D0%BE%D1%80\" title=\"\u0420\u0443\u0437\u0432\u0435\u043b\u044c\u0442, \u0422\u0435\u043e\u0434\u043e\u0440\">\u0420\u0443\u0437\u0432\u0435\u043b\u044c\u0442<\/a> \u0442\u043e\u0440\u0436\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e \u043e\u0431\u044a\u044f\u0432\u0438\u043b \u043e\u0431 \u043e\u0442\u043a\u0440\u044b\u0442\u0438\u0438 \u0442\u0438\u0445\u043e\u043e\u043a\u0435\u0430\u043d\u0441\u043a\u043e\u0439 \u043b\u0438\u043d\u0438\u0438 \u0441\u0432\u044f\u0437\u0438, \u0440\u0430\u0437\u043e\u0441\u043b\u0430\u0432 \u043f\u043e \u043a\u0430\u0431\u0435\u043b\u044e, \u043f\u0440\u043e\u043b\u043e\u0436\u0435\u043d\u043d\u043e\u043c\u0443 \u043f\u043e \u0434\u043d\u0443 \u0422\u0438\u0445\u043e\u0433\u043e \u043e\u043a\u0435\u0430\u043d\u0430, \u0441\u043e\u043e\u0431\u0449\u0435\u043d\u0438\u044f \u043f\u043e \u0432\u0441\u0435\u043c\u0443 \u043c\u0438\u0440\u0443.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1906_%D0%B3%D0%BE%D0%B4\" title=\"1906 \u0433\u043e\u0434\">1906<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B1%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u044f\">\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u044f<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%8F\" title=\"\u0424\u0440\u0430\u043d\u0446\u0438\u044f\">\u0424\u0440\u0430\u043d\u0446\u0438\u044f<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%82%D0%B0%D0%BB%D0%B8%D1%8F\" title=\"\u0418\u0442\u0430\u043b\u0438\u044f\">\u0418\u0442\u0430\u043b\u0438\u044f<\/a> \u0432\u044b\u0441\u0442\u0443\u043f\u0438\u043b\u0438 \u0433\u0430\u0440\u0430\u043d\u0442\u0430\u043c\u0438 \u043d\u0435\u0437\u0430\u0432\u0438\u0441\u0438\u043c\u043e\u0441\u0442\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AD%D1%84%D0%B8%D0%BE%D0%BF%D0%B8%D1%8F\" title=\"\u042d\u0444\u0438\u043e\u043f\u0438\u044f\">\u042d\u0444\u0438\u043e\u043f\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1915_%D0%B3%D0%BE%D0%B4\" title=\"1915 \u0433\u043e\u0434\">1915<\/a>&#160;\u2014 \u043f\u0440\u0430\u0445 \u0430\u0432\u0442\u043e\u0440\u0430 \u00ab\u041c\u0430\u0440\u0441\u0435\u043b\u044c\u0435\u0437\u044b\u00bb <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D1%83%D0%B6%D0%B5_%D0%B4%D0%B5_%D0%9B%D0%B8%D0%BB%D1%8C,_%D0%9A%D0%BB%D0%BE%D0%B4_%D0%96%D0%BE%D0%B7%D0%B5%D1%84\" title=\"\u0420\u0443\u0436\u0435 \u0434\u0435 \u041b\u0438\u043b\u044c, \u041a\u043b\u043e\u0434 \u0416\u043e\u0437\u0435\u0444\">\u0420\u0443\u0436\u0435 \u0434\u0435 \u041b\u0438\u043b\u044f<\/a> \u043f\u0435\u0440\u0435\u0437\u0430\u0445\u043e\u0440\u043e\u043d\u0435\u043d \u0432 \u0414\u043e\u043c\u0435 \u0438\u043d\u0432\u0430\u043b\u0438\u0434\u043e\u0432 \u0432 \u041f\u0430\u0440