2\u043e\u0431\u043e\u0434\u0438\u043b\u0438 \u0437\u0430\u043b\u043e\u0436\u043d\u0438\u043a\u043e\u0432 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A3%D0%B3%D0%B0%D0%BD%D0%B4%D0%B0\" title=\"\u0423\u0433\u0430\u043d\u0434\u0430\">\u0443\u0433\u0430\u043d\u0434\u0438\u0439\u0441\u043a\u043e\u043c<\/a> \u0430\u044d\u0440\u043e\u043f\u043e\u0440\u0442\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AD%D0%BD%D1%82%D0%B5%D0%B1%D0%B1%D0%B5\" title=\"\u042d\u043d\u0442\u0435\u0431\u0431\u0435\">\u042d\u043d\u0442\u0435\u0431\u0431\u0435<\/a>. \u0412 \u0445\u043e\u0434\u0435 \u043f\u0435\u0440\u0435\u0441\u0442\u0440\u0435\u043b\u043a\u0438 \u0431\u044b\u043b\u0438 \u0443\u0431\u0438\u0442\u044b 5 \u0438\u0437\u0440\u0430\u0438\u043b\u044c\u0442\u044f\u043d,6 \u0442\u0435\u0440\u0440\u043e\u0440\u0438\u0441\u0442\u043e\u0432 \u0438 23 \u0443\u0433\u0430\u043d\u0434\u0438\u0439\u0446\u0430. 101 \u0437\u0430\u043b\u043e\u0436\u043d\u0438\u043a \u0431\u044b\u043b \u0441\u043f\u0430\u0441\u0451\u043d.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1982_%D0%B3%D0%BE%D0%B4\" title=\"1982 \u0433\u043e\u0434\">1982<\/a>&#160;\u2014 \u0441\u043f\u0443\u0441\u0442\u044f \u0442\u0440\u0438 \u0433\u043e\u0434\u0430 \u043f\u043e\u0441\u043b\u0435 \u0440\u0430\u0437\u0432\u043e\u0434\u0430 \u0441 \u043f\u0435\u0440\u0432\u043e\u0439 \u0436\u0435\u043d\u043e\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D0%B7%D0%B7%D0%B8_%D0%9E%D1%81%D0%B1%D0%BE%D1%80%D0%BD\" class=\"mw-redirect\" title=\"\u041e\u0437\u0437\u0438 \u041e\u0441\u0431\u043e\u0440\u043d\">\u041e\u0437\u0437\u0438 \u041e\u0441\u0431\u043e\u0440\u043d<\/a> \u0436\u0435\u043d\u0438\u043b\u0441\u044f \u0432\u0442\u043e\u0440\u0438\u0447\u043d\u043e \u043d\u0430 \u0428\u044d\u0440\u043e\u043d \u0410\u0440\u0434\u0435\u043d (Sharon Arden), \u0434\u043e\u0447\u0435\u0440\u0438 \u0441\u0432\u043e\u0435\u0433\u043e \u043c\u0435\u043d\u0435\u0434\u0436\u0435\u0440\u0430. \u0421\u0435\u0433\u043e\u0434\u043d\u044f \u0443 \u043d\u0438\u0445 \u0442\u0440\u043e\u0435 \u0434\u0435\u0442\u0435\u0439, \u0430 \u0428\u044d\u0440\u043e\u043d \u0441\u0442\u0430\u043b\u0430 \u0435\u0433\u043e \u043b\u0438\u0447\u043d\u044b\u043c \u043c\u0435\u043d\u0435\u0434\u0436\u0435\u0440\u043e\u043c.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1986_%D0%B3%D0%BE%D0%B4\" title=\"1986 \u0433\u043e\u0434\">1986<\/a>&#160;\u2014 \u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442 \u0421\u0428\u0410 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B5%D0%B9%D0%B3%D0%B0%D0%BD,_%D0%A0%D0%BE%D0%BD%D0%B0%D0%BB%D1%8C%D0%B4\" title=\"\u0420\u0435\u0439\u0433\u0430\u043d, \u0420\u043e\u043d\u0430\u043b\u044c\u0434\">\u0420\u043e\u043d\u0430\u043b\u044c\u0434 \u0420\u0435\u0439\u0433\u0430\u043d<\/a> \u0432 \u043f\u0440\u0438\u0441\u0443\u0442\u0441\u0442\u0432\u0438\u0438 \u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442\u0430 \u0424\u0440\u0430\u043d\u0446\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B8%D1%82%D1%82%D0%B5%D1%80%D0%B0%D0%BD,_%D0%A4%D1%80%D0%B0%D0%BD%D1%81%D1%83%D0%B0\" title=\"\u041c\u0438\u0442\u0442\u0435\u0440\u0430\u043d, \u0424\u0440\u0430\u043d\u0441\u0443\u0430\">\u0424\u0440\u0430\u043d\u0441\u0443\u0430 \u041c\u0438\u0442\u0442\u0435\u0440\u0430\u043d\u0430<\/a> (Fran\u00e7ois Maurice Adrien Marie Mitterrand) \u0442\u043e\u0440\u0436\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e \u043e\u0442\u043a\u0440\u044b\u043b \u043f\u043e\u0441\u043b\u0435 \u0440\u0435\u043a\u043e\u043d\u0441\u0442\u0440\u0443\u043a\u0446\u0438\u0438 \u0421\u0442\u0430\u0442\u0443\u044e \u0421\u0432\u043e\u0431\u043e\u0434\u044b \u0432 \u041d\u044c\u044e-\u0419\u043e\u0440\u043a\u0435.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1987_%D0%B3%D0%BE%D0%B4\" title=\"1987 \u0433\u043e\u0434\">1987<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0\" title=\"\u041c\u043e\u0441\u043a\u0432\u0430\">\u041c\u043e\u0441\u043a\u0432\u0435<\/a> \u043f\u0440\u043e\u0448\u0451\u043b 4-\u0439 \u0444\u0435\u0441\u0442\u0438\u0432\u0430\u043b\u044c \u00ab\u0417\u0430 \u043c\u0438\u0440\u00bb \u0441 \u0443\u0447\u0430\u0441\u0442\u0438\u0435\u043c \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/The_Doobie_Brothers\" title=\"The Doobie Brothers\">The Doobie Brothers<\/a>\u00bb, \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BD%D1%82%D0%B0%D0%BD%D0%B0,_%D0%9A%D0%B0%D1%80%D0%BB%D0%BE%D1%81\" title=\"\u0421\u0430\u043d\u0442\u0430\u043d\u0430, \u041a\u0430\u0440\u043b\u043e\u0441\">Santana<\/a>\u00bb, \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/Bonnie_Raitt\" class=\"mw-redirect\" title=\"Bonnie Raitt\">Bonnie Raitt<\/a>\u00bb, \u0430 \u0442\u0430\u043a\u0436\u0435 \u0441\u043e\u0432\u0435\u0442\u0441\u043a\u0438\u0445 \u0440\u043e\u043a-\u0433\u0440\u0443\u043f\u043f.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1989_%D0%B3%D0%BE%D0%B4\" title=\"1989 \u0433\u043e\u0434\">1989<\/a>&#160;\u2014 \u043f\u0438\u043b\u043e\u0442 \u0441\u0430\u043c\u043e\u043b\u0451\u0442\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B8%D0%93-23\" title=\"\u041c\u0438\u0413-23\">\u041c\u0438\u0413-23<\/a> \u0412\u0412\u0421 \u0421\u0421\u0421\u0420, \u0432\u0437\u043b\u0435\u0442\u0435\u0432\u0448\u0435\u0433\u043e \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BE%D0%BB%D1%8C%D1%88%D0%B0\" title=\"\u041f\u043e\u043b\u044c\u0448\u0430\">\u041f\u043e\u043b\u044c\u0448\u0435<\/a>, \u043a\u0430\u0442\u0430\u043f\u0443\u043b\u044c\u0442\u0438\u0440\u043e\u0432\u0430\u043b\u0441\u044f \u043d\u0430 41-\u0439 \u0441\u0435\u043a\u0443\u043d\u0434\u0435 \u043f\u043e\u043b\u0451\u0442\u0430; \u043d\u0435\u0443\u043f\u0440\u0430\u0432\u043b\u044f\u0435\u043c\u044b\u0439 \u0441\u0430\u043c\u043e\u043b\u0451\u0442 \u043f\u0440\u043e\u043b\u0435\u0442\u0435\u043b 900&#160;\u043a\u043c \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%82%